script: |
  super -f tsv -I q4248.sql | sort > q4248.out

vector: true

inputs:
  - name: q4248.sql
    data: |
      SELECT col2 AS col1, + 57 FROM tab1 WHERE col2 NOT BETWEEN - col1 AND ( col0 * - + ( - - 53 ) + - col2 );
  - name: tab1

outputs:
  - name: q4248.out
    data: |
      59	57
      68	57
      96	57
